import React from "react";

function FunctionalComponent(props) {
  const foods = props.foods;
  console.log(foods);
  const elements = (
    <ol>
      {props.foods.map(val => {
        return (
          <li key={val.id}>
            {" "}
            {val.name} : {val.price}
          </li>
        );
      })}
    </ol>
  );
  return <div>{elements}</div>;
}

export default FunctionalComponent;
